import "./profile.css";
import profile from './profile.svg';



const Profile= ()=>{
    return(



        <div className="profile">
            <div className="head">
                <h2>Donors</h2>
            </div>
            <div className="icons">
            <img src={profile} className='prof' alt='logoo'/>

            </div>

        </div>



    )
}


export default Profile;
